// src/components/MainPage.js
import React, { useState, useEffect } from "react";

const MainPage = ({ token, logout }) => {
  const [habits, setHabits] = useState([]);
  const [newHabit, setNewHabit] = useState("");
  const [loading, setLoading] = useState(true);

  // Fetch habits from backend
  useEffect(() => {
    const fetchHabits = async () => {
      try {
        const res = await fetch("http://localhost:5000/api/habits", {
          headers: { Authorization: `Bearer ${token}` },
        });
        const data = await res.json();
        if (Array.isArray(data)) {
          setHabits(data);
        } else if (Array.isArray(data.habits)) {
          setHabits(data.habits);
        } else {
          setHabits([]);
        }
      } catch (err) {
        console.error("Error fetching habits:", err);
        setHabits([]);
      } finally {
        setLoading(false);
      }
    };
    fetchHabits();
  }, [token]);

  // Add new habit
  const addHabit = async () => {
    if (!newHabit) return;
    try {
      const res = await fetch("http://localhost:5000/api/habits", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify({ name: newHabit }),
      });
      const habit = await res.json();
      setHabits((prev) => [...prev, habit]);
      setNewHabit("");
    } catch (err) {
      console.error("Error adding habit:", err);
    }
  };

  // Toggle habit completion
  const toggleDone = async (habitId) => {
    try {
      const res = await fetch(`http://localhost:5000/api/habits/${habitId}`, {
        method: "PATCH",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify({ done: !habits.find(h => h._id === habitId)?.done }),
      });
      const updated = await res.json();
      setHabits((prev) => prev.map(h => (h._id === habitId ? updated : h)));
    } catch (err) {
      console.error("Error updating habit:", err);
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Habit Tracker</h1>

      <div style={styles.inputContainer}>
        <input
          type="text"
          placeholder="Add new habit"
          value={newHabit}
          onChange={(e) => setNewHabit(e.target.value)}
          style={styles.input}
        />
        <button onClick={addHabit} style={styles.addButton}>Add</button>
        <button onClick={logout} style={styles.logoutButton}>Logout</button>
      </div>

      {loading ? (
        <p>Loading habits...</p>
      ) : habits.length === 0 ? (
        <p>No habits yet. Add one above!</p>
      ) : (
        <ul style={styles.list}>
          {habits.map((habit) => (
            <li key={habit._id} style={styles.listItem}>
              <input
                type="checkbox"
                checked={habit.done || false}
                onChange={() => toggleDone(habit._id)}
              />
              <span style={{ textDecoration: habit.done ? "line-through" : "none", marginLeft: 8 }}>
                {habit.name}
              </span>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

// Inline CSS
const styles = {
  container: {
    maxWidth: 500,
    margin: "50px auto",
    padding: 20,
    border: "1px solid #ddd",
    borderRadius: 10,
    backgroundColor: "#f9f9f9",
    boxShadow: "0 0 10px rgba(0,0,0,0.1)",
    fontFamily: "Arial, sans-serif",
  },
  title: { textAlign: "center", marginBottom: 20 },
  inputContainer: { display: "flex", marginBottom: 20, gap: 10 },
  input: { flex: 1, padding: 8, borderRadius: 5, border: "1px solid #ccc" },
  addButton: { padding: "8px 12px", borderRadius: 5, backgroundColor: "#4CAF50", color: "#fff", border: "none" },
  logoutButton: { padding: "8px 12px", borderRadius: 5, backgroundColor: "#f44336", color: "#fff", border: "none" },
  list: { listStyle: "none", padding: 0 },
  listItem: {
    padding: 10,
    borderBottom: "1px solid #ddd",
    display: "flex",
    alignItems: "center",
  },
};

export default MainPage;
